import React from 'react';
import './card.css';

export default class Card extends React.Component {
    
    render() {
        const  newarr = data.slice(0, 2);
        return (
        newarr.map((item) => {
        return (
            <article className="card-item">
        <div className="cards-image__container">
            <img className="cards-image" src={require('./img/test.png')} alt="anapa"/>
        </div>
        <section className="card-item__description">
            <h4 className="description-name">{ item.title }</h4>
            <p className="track-shedule"><b>Маршрут:</b>{ item.track }</p>
            <p className="duration"><b>Продолжительность:</b>{}</p>
            <p className="price">27 000 руб</p>
        </section>
    </article>)
        })
    )}
};
